import React from 'react';

const Navbar = ({ toggleIndustries }) => {
  return (
    <nav className="navbar navbar-expand-md navbar-dark bg-dark w-100">
      <a className="navbar-brand heading-black" href="#home">
        <img
          src="img/monogram-hq-2.png"
          alt="Devevolution Logo"
          className="logo-img"
        />
      </a>
      <div className="collapse navbar-collapse">
        <ul className="navbar-nav ml-auto">
          <li className="nav-item">
            <button className="nav-link" onClick={toggleIndustries}>
              Industries
            </button>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
